import Footer from "../components/Footer";
import SignUpForm from "../components/SignUpForm";


function SignUp() {
  return (
    <>
      <Hero cName="hero-mid" title="SignUp Page" btnClass="hide" />
      <SignUpForm/>
      <Footer/>
    </>
  );
}

export default SignUp;
